import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity } from 'react-native';
import { useSelector } from 'react-redux';
import TarotCard from '../../components/cards/TarotCard';
import TarotCard3D from '../../components/3d/TarotCard3D';
import Button from '../../components/common/Button';
import AudioReactiveComponent from '../../components/animations/AudioReactiveComponent';

const CardDetailScreen = ({ route, navigation }) => {
  const { cardId } = route.params;
  const [card, setCard] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [isFlipped, setIsFlipped] = useState(false);
  const [use3D, setUse3D] = useState(true);
  const [audioEnabled, setAudioEnabled] = useState(false);

  const cards = useSelector(state => state.tarot.cards);

  useEffect(() => {
    // Find the card from Redux store
    const foundCard = cards.find(c => c.id === cardId);
    if (foundCard) {
      setCard(foundCard);
    } else {
      setError('Card not found');
    }
    setLoading(false);
  }, [cardId, cards]);

  const handleFlip = (flipped) => {
    setIsFlipped(flipped);
  };

  const toggleAudio = () => {
    setAudioEnabled(!audioEnabled);
  };

  const toggle3D = () => {
    setUse3D(!use3D);
  };

  if (loading) {
    return (
      <View style={styles.loadingContainer}>
        <Text style={styles.loadingText}>Loading card details...</Text>
      </View>
    );
  }

  if (error || !card) {
    return (
      <View style={styles.errorContainer}>
        <Text style={styles.errorText}>{error || 'Card not found'}</Text>
        <Button 
          title="Go Back" 
          onPress={() => navigation.goBack()} 
          type="secondary"
        />
      </View>
    );
  }

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <Text style={styles.title}>{card.name}</Text>

      <View style={styles.cardInfoRow}>
        <Text style={styles.cardInfoText}>
          {card.arcana} • {card.number} • {card.suit || 'No Suit'}
        </Text>
      </View>

      <View style={styles.cardContainer}>
        {audioEnabled ? (
          <AudioReactiveComponent 
            audioFile="../../assets/audio/effects/magical_chime.mp3"
            sensitivity={2}
            autoPlay={true}
            loop={true}
            visualizerType="pulse"
            style={styles.audioContainer}
          >
            {use3D ? (
              <TarotCard3D 
                card={card}
                onFlip={handleFlip}
                initiallyFlipped={isFlipped}
              />
            ) : (
              <TarotCard 
                card={card}
                onFlip={handleFlip}
                isFlipped={isFlipped}
              />
            )}
          </AudioReactiveComponent>
        ) : (
          use3D ? (
            <TarotCard3D 
              card={card}
              onFlip={handleFlip}
              initiallyFlipped={isFlipped}
            />
          ) : (
            <TarotCard 
              card={card}
              onFlip={handleFlip}
              isFlipped={isFlipped}
            />
          )
        )}
      </View>

      <View style={styles.optionsContainer}>
        <Button 
          title={audioEnabled ? "Disable Audio" : "Enable Audio"} 
          onPress={toggleAudio} 
          type="outline"
          size="small"
          style={styles.optionButton}
        />
        <Button 
          title={use3D ? "Use 2D Card" : "Use 3D Card"} 
          onPress={toggle3D} 
          type="outline"
          size="small"
          style={styles.optionButton}
        />
      </View>

      <View style={styles.interpretationContainer}>
        <Text style={styles.sectionTitle}>Modern Interpretation</Text>
        <Text style={styles.interpretationText}>{card.modern_interpretation}</Text>
      </View>

      {card.keywords && card.keywords.length > 0 && (
        <View style={styles.keywordsContainer}>
          <Text style={styles.sectionTitle}>Keywords</Text>
          <View style={styles.keywordsList}>
            {card.keywords.map((keyword, index) => (
              <View key={index} style={styles.keywordBadge}>
                <Text style={styles.keywordText}>{keyword}</Text>
              </View>
            ))}
          </View>
        </View>
      )}

      {card.meanings && (
        <View style={styles.meaningsContainer}>
          <Text style={styles.sectionTitle}>Traditional Meanings</Text>

          {card.meanings.light && card.meanings.light.length > 0 && (
            <View style={styles.meaningSection}>
              <Text style={styles.meaningTitle}>Upright</Text>
              {card.meanings.light.map((meaning, index) => (
                <Text key={index} style={styles.meaningText}>• {meaning}</Text>
              ))}
            </View>
          )}

          {card.meanings.shadow && card.meanings.shadow.length > 0 && (
            <View style={styles.meaningSection}>
              <Text style={styles.meaningTitle}>Reversed</Text>
              {card.meanings.shadow.map((meaning, index) => (
                <Text key={index} style={styles.meaningText}>• {meaning}</Text>
              ))}
            </View>
          )}
        </View>
      )}

      {card.affirmation && (
        <View style={styles.affirmationContainer}>
          <Text style={styles.sectionTitle}>Affirmation</Text>
          <Text style={styles.affirmationText}>{card.affirmation}</Text>
        </View>
      )}

      {card.fortune_telling && card.fortune_telling.length > 0 && (
        <View style={styles.fortuneContainer}>
          <Text style={styles.sectionTitle}>Fortune Telling</Text>
          {card.fortune_telling.map((fortune, index) => (
            <Text key={index} style={styles.fortuneText}>• {fortune}</Text>
          ))}
        </View>
      )}

      <View style={styles.actionsContainer}>
        <Button 
          title="Add to Journal" 
          onPress={() => navigation.navigate('Journal', {
            screen: 'JournalEntry',
            params: {
              cardId: card.id
            }
          })} 
          type="secondary"
          style={styles.actionButton}
        />
        <Button 
          title="Back to Library" 
          onPress={() => navigation.goBack()} 
          type="outline"
          style={styles.actionButton}
        />
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    backgroundColor: '#FAF3E0',
    padding: 20,
    paddingBottom: 40,
  },
  loadingContainer: {
    flex: 1,
    backgroundColor: '#FAF3E0',
    justifyContent: 'center',
    alignItems: 'center',
  },
  loadingText: {
