  },
  cardInfoRow: {
    alignItems: 'center',
    marginBottom: 20,
  },
  cardInfoText: {
    fontSize: 16,
    color: '#8E44AD',
    fontStyle: 'italic',
  },
  cardContainer: {
    alignItems: 'center',
    marginBottom: 20,
  },
  audioContainer: {
    borderRadius: 20,
    padding: 20,
  },
  optionsContainer: {
    flexDirection: 'row',
    justifyContent: 'center',
    marginBottom: 30,
  },
  optionButton: {
    marginHorizontal: 5,
  },
  interpretationContainer: {
    backgroundColor: '#FFFFFF',
    borderRadius: 10,
    padding: 15,
    marginBottom: 20,
    borderWidth: 1,
    borderColor: '#E0D4C0',
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#9B59B6',
    marginBottom: 10,
  },
  interpretationText: {
    fontSize: 16,
    color: '#4A4A4A',
    lineHeight: 24,
  },
  keywordsContainer: {
    marginBottom: 20,
  },
  keywordsList: {
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  keywordBadge: {
    backgroundColor: '#F0E6D2',
    paddingHorizontal: 12,
    paddingVertical: 6,
    borderRadius: 20,
    marginRight: 8,
    marginBottom: 8,
  },
