    fontWeight: 'bold',
    color: '#8E44AD',
    marginBottom: 8,
  },
  meaningText: {
    fontSize: 16,
    color: '#4A4A4A',
    marginBottom: 5,
    lineHeight: 22,
  },
  affirmationContainer: {
    backgroundColor: '#F0E6D2',
